// ** users.component.js ** //

import React, { Component } from 'react';
import axios from 'axios';
import DataTable from './data-table';

export default class Models extends Component {
   
    constructor(props) {
        super(props);
        this.state = { usersCollection: [] };
    }
   
    componentDidMount() {
        axios.get('https://api.models.com/prosearch/sitesearch19-json.html?mdcsearch=ce')
            .then(res => {
                
                this.setState({ 
                    modelsCollection: res.data.people,
                    isLoading: false

                 });
                console.log('rmodelsCollectiones ', modelsCollection)
            })
            .catch(function (error) {
                console.log(error);
            })
    }

     dataTable() {
        return this.state.modelsCollection.map((data, i) => {
            return <DataTable obj={data} key={i} />;
        });
    } 
   
    render() {
        return (
            <div className="wrapper-users">
                <div className="container">
                    <table className="table table-striped table-dark">
                        <thead className="thead-dark">
                            <tr>
                                <td>SLUG</td>
                                <td>Name</td>
                                <td>TYPE</td>
                            </tr>
                        </thead>
                        <tbody>
                             {this.dataTable()} 
                        </tbody>
                    </table>
                </div>
            </div>
        )
    }
}
